script: |
  super -f tsv -I q5210.sql | sort > q5210.out

vector: true

inputs:
  - name: q5210.sql
    data: |
      SELECT CASE + - COUNT ( * ) WHEN - MIN ( 90 ) THEN + + COALESCE ( + COUNT ( ALL + 91 ), - MAX ( + + 75 ), - 54 * 60, - - 28 ) ELSE 20 END;

outputs:
  - name: q5210.out
    data: |
      20
